import React from 'react'
import './App.css';
import axios from 'axios'
import { useEffect, useState } from 'react';

import {GenerateBantuan} from './GenerateBantuan'
function DataBantuan() {
  const [data, setData] = useState([])
  const fileName = "mysamplefile"; // here enter filename for your excel file

  const fetchCoba = async () => {
    await axios
      .get(`http://localhost:8000/api/dana_bantuans`)
      .then(({ data }) => {
        setData(data)
        console.log(data)
      });
  };

  useEffect(() => {
    fetchCoba();
  }, []);
 
  return (
    <div className="App">
      <GenerateBantuan apiData={data} fileName={fileName} />
    </div>
  );
}


export default DataBantuan;
